import React from "react";
import { Carousel } from "antd";
import "./CarouselPicture.sass";

const CarouselPicture = (data) => {
  console.log(data);
  const onChange = (e) => {
    console.log(e);
  };
  return (
    <Carousel afterChange={onChange} className="carousel">
      <div>
        <img
          src={
            "https://images.pexels.com/photos/17568714/pexels-photo-17568714.jpeg?auto=compress&cs=tinysrgb&h=650&w=940"
          }
          alt=""
        />
      </div>
      <div>
        <img
          src={
            "https://images.pexels.com/photos/17660191/pexels-photo-17660191.jpeg?auto=compress&cs=tinysrgb&h=650&w=940"
          }
          alt=""
        />
      </div>
      <div>
        <img
          src={
            "https://images.pexels.com/photos/17568714/pexels-photo-17568714.jpeg?auto=compress&cs=tinysrgb&h=650&w=940"
          }
          alt=""
        />
      </div>
      <div>
        <img
          src={
            "https://images.pexels.com/photos/17568714/pexels-photo-17568714.jpeg?auto=compress&cs=tinysrgb&h=650&w=940"
          }
          alt=""
        />
      </div>
      <div>
        <img
          src={
            "https://images.pexels.com/photos/17568714/pexels-photo-17568714.jpeg?auto=compress&cs=tinysrgb&h=650&w=940"
          }
          alt=""
        />
      </div>
    </Carousel>
  );
};

export default CarouselPicture;
